"use strict";

const BinaryStoreError = require("./binarystore-error.js");

class DuplicateKey extends BinaryStoreError {
  constructor(cause, message) {
    super(message || "UuBinary attributes violate index uniqueness.", cause);
    this.code = `${BinaryStoreError.ERROR_PREFIX}duplicateKey`;
  }
}

module.exports = DuplicateKey;
